    {
      id: 3,
      name: 'Canon 60D',
      image: 'https://via.placeholder.com/300',
    },
  ]);

  return (
    <>
      <div className='cards'>
        <h1>Check out these EPIC Destinations!</h1>
        <div className='cards__container'>
          <div className='cards__wrapper'>
            <ul className='cards__items'>
              {articles.map((article) => (
                <CardItem
                  src={article.image}
                  text='Travel through'
                  label='Luxury'
                  path='/services'
                />
              ))}
            </ul>
          </div>
        </div>
      </div>
    </>
  );
}
